import React from "react";
import { WithContext as ReactTags } from "react-tag-input";

export default function TagsMember({ value, onChange }) {
    const KeyCodes = {
        comma: 188,
        enter: 13
    };

    const delimiters = [KeyCodes.comma, KeyCodes.enter];

    const handleDelete = i => {
        onChange({
            target: {
                name: "member",
                value: value.filter((tag, index) => index !== i)
            }
        });
    };

    const handleAddition = tag => {
        onChange({
            target: {
                name: "member",
                value: [...value, tag]
            }
        });
    };

    return (
        <ReactTags
            classNames={{
                tags: "tagsClass",
                selected: "selectedClass",
                tag: "tagClass",
                remove: "removeClass"
            }}
            placeholder={"Add member"}
            tags={value} 
            autofocus={false}
            handleDelete={handleDelete}
            handleAddition={handleAddition}
            allowDragDrop={false}
            delimiters={delimiters}
        />
    );
}

import actionType from "../constants/actionTypes";
import scheduleApi from "../../api/scheduleApi";
import history from "../../helper/history";

export const addSchedule = schedule => {
    return dispatch => {
        dispatch({ type: actionType.ADD_SCHEDULE_BEGIN });
        scheduleApi
            .addSchedule(schedule)
            .then(res => {
                dispatch({
                    type: actionType.ADD_SCHEDULE_SUCCESS,
                    payload: res
                });
                history.push("/list");
                dispatch(getSchedules())
            })
            .catch(err => {
                dispatch({ type: actionType.ADD_SCHEDULE_FAILURE });
            });
    };
};

export const getSchedules = () => {
    return dispatch => {
        dispatch({ type: actionType.GET_ALL_SCHEDULE_BEGIN });
        scheduleApi
            .getSchedules()
            .then(res => {
                dispatch({
                    type: actionType.GET_ALL_SCHEDULE_SUCCESS,
                    payload: res.data
                });
            })
            .catch(err => {
                dispatch({ type: actionType.GET_ALL_SCHEDULE_FAILURE });
            });
    };
};

